import React from 'react';
import Header from '../components/Header';

const Home: React.FC = () => {
    return (
        <div>
          <Header />
          <main>
            <h2>Bem-vindo ao Meu Projeto</h2>
            <p>Essa é a página inicial.</p>
          </main>
        </div>
      );
  };
  
  export default Home;
